pub enum BufferError {

    /// The offset exceeds the buffer length
    #[fail(display = "Offset {} exceed the buffer length {}", _0, _1)]
    BadOffset(usize, usize),

    /// The buffer is not resized
    #[fail(display = "Buffer is not resized")]
    NotResized,

    /// The struct exceeds the remaining buffer length
    #[fail(display = "Struct size {} exceeds the remaining buffer length {}",
           _0, _1)]
    OutOfBuffer(usize, usize),
}

enum MbufInner {

    /// Original version of the message buffer
    /// Should be freed when goes out of scope
    /// Pointer returned to DPDK
    Original(NonNull<dpdk_ffi::rte_mbuf>),

    /// A clone version of the message buffer
    /// should not be freed when it goes out of scope
    Clone(NonNull<dpdk_ffi::rte_mbuf>),
}

pub enum MempoolError {

    #[fail(display = "Cannot allocate a new mbuf from mempool")]
    Exhausted,

    #[fail(display = "Mempool for {:?} not found.", _0)]
    NotFound(SocketId),
}

pub enum PortError {

    /// Port is not found
    #[fail(display = "Port {} is not found.", _0)]
    NotFound(String),

    /// Port is not bound
    #[fail(display = "Port is not bound to any cores.")]
    CoreNotBound,

    /// The maximum number of RX queues is less than
    /// the number of cores assigned to the port
    #[fail(display = "Insufficient number of RX queues '{}'.", _0)]
    InsufficientRxQueues(usize),

    /// The maximum number of TX queues is less than
    /// the number of cores assigned to the port
    #[fail(display = "Insufficient number of TX queues '{}'.", _0)]
    InsufficientTxQueues(usize),
}

pub enum CidrError {

    /// Error returned when parsing a malformed CIDR range.
    #[fail(display = "Failed to parse CIDR: {}", _0)]
    Malformed(String),

    /// Error returned when converting from v4/v6 address mask to a prefix length.
    #[fail(display = "Invalid prefix length")]
    InvalidPrefixLength,
}

pub(crate) enum CoreError {

    /// Core is not found
    #[fail(display = "{:?} is not found", _0)]
    NotFound(CoreId),

    /// Core is not assigned to any port
    #[fail(display = "{:?} is not assigned to any port", _0)]
    NotAssigned(CoreId),
}
